import React from "react"

function TabelaKarte(props){
    const karte= props.state.karte.map(k => <tr>
                                                <td>{k.datumVremeProdaje}</td>
                                            </tr>
    )
    return(
        <table>
            <thead>
                <th>Vreme prodaje karte</th>
            </thead>
            <tbody>
                {karte}
            </tbody>
        </table>
    )
}
export default TabelaKarte
